import React from "react";
import Post from "./Components/Post";

function Posts(props) {
  return props.posts.map((post) => (
    <Post
      userName={post.userName}
      caption={post.caption}
      imageUrl={post.imageUrl}
    />
  ));
}

export default Posts;
